"r
さて今回いただいたのは、水蜜桃のパフェ1320円。大阪でも東京でもわずか2日ほどで完売した、もはや幻のパフェ。かなり長いこと通い続けているが、今回の人気は全く想定していなかった。今までこちらでは売り切れという事態に遭遇したことがなかったので。"r
"r
桃が人気なのはもちろん理解しているが、まさかこれほどまでとは。今回の件は自分の読みが甘かったとしか言いようがない。大いに反省して今後のカフェ巡りに活かしたい。"r

桃と杏と李と扁桃の甘酸っぱさと芳醇さが絶妙に絡み合う、これぞ関西最後の桃源郷。このパフェ自体が癒やしスポット。すももももももアーモンドも、桃のうちってことやんね！"r
"r
メインのジェラートは、桃のジェラートが2スクープとアプリコットのジェラート。桃のジェラートがとにかく優しくて癒やされる。しっとりと体に馴染んでいく魅惑のジェラート。一口目から勝負ありやったね。アプリコットのジェラートは、ファーイーストさんらしい濃厚なねっとり感がたまらない。"r

桃源郷のフィナーレは、アーモンドのムース・桃のコンポート・スモモのジュレと下に行けば行くほど酸味とさわやかさも増していき、パフェのセオリー通りさっぱりと食べ終わることができる。妖艶で華やかな桃の魅力を最大限に引き出し、桃パフェの新たな可能性を広げてくれたような気がする。

桃のパフェは早々に終了して、いま提供されているのは以前に載せた抹茶のパフェ。"r
